import React from 'react'
import '../styles/regions.css';
import { BrowserRouter as Router,Routes,Route } from 'react-router-dom';
import South from '../myCompnents/South';
import Hazara from '../myCompnents/Hazara';
import Malakand from '../myCompnents/Malakand';
import Watershed from '../myCompnents/Watershed';
export default function Regions() {
  return (
    <div className='regionscontainer'>
      
      <Router>
      <h3>Select Any Region:</h3>
      <select >
        <option>South</option>
        <option>Malakand</option>
        <option>Hazara</option>
        <option>WaterShed</option>
      </select>
        <Routes>
          <Route path='/' element={<South/>}/>
          <Route path='/malakand' element={<Malakand/>}/>
          <Route path='/hazara' element={<Hazara/>}/>
          <Route path='/watershed' element={<Watershed/>}/>
        </Routes>
      </Router>
    </div>
  )
}
